var $ = cheerio.load(html)
var list = []

$('a').each(function (idx, sItem) {
    var current = {}
    current.urL = $(sItem).attr('href')
    current.date = $(sItem).attr('add_date')
    current.icon = $(sItem).attr('icon')
    current.title = $(sItem).text()
    current.mTitle = '生活'
    current.type = 'mm'
    current.digest = current.title
    current.source = ''
    list.push(current)
})

const file = __dirname + '/data/bk_mm.json'
 
jsonfile.writeFile(file, list, function (err) {
  if (err) console.error(err)
})